import React from 'react'
import Ddata from "./Ddata"
import Slider from 'react-slick';

const Dcard = () => {
    var settings = {
        dots: false,
        infinite: true,
        speed: 500,
        slidesToShow: 3,
        slidesToScroll: 1,
        autoplay: true,
    };

    return (
        <>
            <Slider {...settings}>
                {
                    Ddata.map((value, index) => {
                        return (
                            <div className="box product" key={index}>
                                <div className="img">
                                    <img src={value.cover} alt="" />
                                </div>
                                <h4>{value.name}</h4>
                                <span>{value.price}</span>
                            </div>
                        )
                    })
                }
            </Slider>
        </>
    )
}

export default Dcard
